:\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '1', '2', '', '', '1', '258', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', ''), ('130', '394', 'Witamy w Kawiarni Zielona Sofa', 'witamy-w-kawiarni-zielona-sofa', '<p style=\"text-align: left;\">Nasza kawiarnia powstała w roku 2014. Rozkwitła na uroczym podzamczańskim osiedlu zapraszając niespotykanymi smakami i dobrą atmosferą. W 2017 roku została przeniesiona w mury kamienicy zlokalizowanej na wałbrzyskiej star&oacute;wce. Wszystko, czego możecie posmakować powstaje z czystej pasji. Najważniejsza dla nas jest jakość. <br />W poszukiwaniu receptur gotowi jesteśmy przemierzać cały świat, odkrywać i doskonalić nowe połączenia smak&oacute;w.<br />W Zielonej Sofie posmakujecie klasycznej już kawy z białym serem i chałwą, zatopicie się w serku lawendowym - pachnącym słońcem i sierpniowym chorwackim tarowiskiem - okraszonym puszystymi bezami. Rozpłynąć się możecie w tradycyjnych lodach waniliowych obficie polanych słonym karmelem naszej receptury. Orzeźwić się lemoniadą inspirowaną Prowansją - z dodatkiem bazylii i limonki, czy tą zupełnie polską - z rozmarynem i fiołkiem. Smaki, jakie u nas spotkacie są efektem miłości- do odkrywania świata i jego dobrodziejstw.</p>\r\n<p style=\"text-align: left;\"><br />Zapraszamy na Uśmiech, Słowo, Brzęknięcie, Szept&hellip;. W nasze skromne progi.</p>\r\n<p style=\"text-align: left;\">Możecie się już wybrać z Google Maps na spacer po naszej kawiarni klikajcie w link, wyszukajcie nas na mapach Google i spacerujące r&oacute;wnież wirtualnie po Zielonej Sofie!</p>\r\n<p><a href=\"https://goo.gl/maps/gjNtt6fEJnSGYcqm8\" target=\"_blank\">https://goo.gl/maps/gjNtt6fEJnSGYcqm8</a></p>\r\n<h4>Godziny otwarcia:</h4>\r\n<h5>poniedzi